export default {
  data() {
    return {
      misiones: []
    };
  },
  created() {
    this.fetchMisiones();
  },
  methods: {
    async fetchMisiones() {
      try {
        const response = await this.$axios.get('/api/mision');
        this.misiones = response.data;
      } catch (error) {
        console.error(error);
      }
    }
  }
};
